import React from "react";
import PropTypes from 'prop-types';
import Logo from "../img/logo_v3-removed.png";
import Navbar from "./HeaderNavbar";

function Header() {
  return (
    <div>
      <div id="logo-div-style">
        <img id="logo-style"src={Logo} alt="logo"></img>
      </div>
      <div id="div-navbar">
        <Navbar />
      </div>
    </div>


  );
}

export default Header;
